import {Image, ScrollView, StyleSheet, TouchableOpacity} from 'react-native';
import OnBoarding from '../components/OnBoarding';
import { Text, View } from '../components/Themed';
import Forms  from '../components/Forms';
import { RootTabScreenProps } from '../../types';

const coffee = require('../assets/images/coffee.png');
const art = require('../assets/images/art.png');
import {Dimensions} from 'react-native'
const DeviceWidth = Dimensions.get('window').width

export default function TabOneScreen({ navigation }: RootTabScreenProps<'TabOne'>) {
    return (
        <ScrollView>
        <View style={styles.container}>
      {/*<Text style={styles.title}>Tab One</Text>Text*/}
      {/*<View style={styles.separator} lightColor="#eee" darkColor="rgba(255,255,255,0.1)" />*/}
      {/*<EditScreenInfo path="/screens/TabOneScreen.tsx" />*/}
      {/*  <OnBoarding*/}
      {/*    title={"hehe"}*/}
      {/*    subtitle={"hehe"}*/}
      {/*    img={coffee}/>*/}
            <TouchableOpacity>
            <Image
                style={{
                    width: 150,
                    height: 130,
                    resizeMode: "contain",
                }}
                source={{uri: art}}/>
            </TouchableOpacity>
            <View style={{
                flexDirection: 'row',
                flex: 1,
                justifyContent: 'center',
                alignItems: 'center',
            }}>
                <View>
                    <View style={{width: DeviceWidth*0.2, height: DeviceWidth*0.2, marginBottom:10, marginLeft:10, backgroundColor: 'powderblue'}} />
                    <View style={{width: DeviceWidth*0.2, height: DeviceWidth*0.2, marginBottom:10, marginLeft:10, backgroundColor: 'skyblue'}} />
                </View>
                <View>
                    <View style={{width: DeviceWidth*0.2, height: DeviceWidth*0.2, marginBottom:10, marginLeft:10, backgroundColor: 'powderblue'}} />
                    <View style={{width: DeviceWidth*0.2, height: DeviceWidth*0.2, marginBottom:10, marginLeft:10, backgroundColor: 'skyblue'}} />
                </View>
            </View>
            <Forms
            placeholder={"Anjay"}/>
        </View>
        </ScrollView>
);
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
